import React from "react";
import { IToDo, toDoState } from "./atoms";
import { useSetRecoilState } from "recoil";

function ToDo({ text, category, id }: IToDo) {
    // const setToDos = useSetRecoilState(toDoState);
    const onClickT = (newCategory: IToDo["category"]) => {};

    return (
        <li>
            <span>{text}</span>

            {category !== "DOING" && (
                <button name="DOING" onClick={() => onClickT("DOING")}>
                    Doing
                </button>
            )}
            {category !== "TO_DO" && (
                <button name="TO_DO" onClick={() => onClickT("TO_DO")}>
                    To Do
                </button>
            )}
            {category !== "DONE" && (
                <button name="DONE" onClick={() => onClickT("DONE")}>
                    Done
                </button>
            )}
        </li>
    );
}

export default ToDo;
